                                                                                                                                                                                                        A Assembléia Legislativa representa o Poder Legislativo do Estado do Amapá. Os representantes do povo amapaense compõe-se atualmente de 24 Deputados Estaduais eleitos pelo sistema proporcional para mandato de quatro anos.
O Poder Legislativo Amapaense dispõe sobre as matérias de competência legislativa do Estado, além de exercer a fiscalização dos atos do Poder Executivo, nos termos das Constituições Federal e Estadual.
                        A Legislatura,  correspondente ao período de 4 anos, é a duração do mandato do Deputado eleito.
