* Desde o ano de 1955 até o ano de 2001, a sede da Câmara Municipal de Careaçu funcionou no prédio da Prefeitura Municipal, na Avenida Saturnino de Faria, 140. A partir de 2002 a Câmara Municipal de Careaçu passou a ter sede própria através da doação de um imóvel localizado na Rua José Joaquim Gouveia, n.º 67, que era a antiga sede do Clube da Associação Operária de Careaçu; 

* A doação foi registrada na Ata da Assembléia Geral Extraordinária, realizada no dia 09 de novembro de 2001, quando os membros da associação decidiram por unanimidade que a doação do imóvel para a Câmara seria a melhor decisão;

* A Lei n.º 001/2001 autorizou o Legislativo Municipal a receber o imóvel em doação e, a partir de então, foram realizadas as reformas necessárias e em   a Câmara Municipal de Careaçu foi inaugurada e passou a ter sede própria na Rua José Joaquim Gouveia, n.º 67, onde se encontra em pleno funcionamento nos dias de hoje.

