                         A história da Câmara Municipal de Rio Novo do Sul teve seu início no período em que o Município foi desmembrado por meio de emancipação, do município a que pertencia, Itapemirim.
O desmembramento do então distrito de Itapemirim ocorreu em 23 de novembro de 1893 e sua instalação deu-se no dia 6 de janeiro de 1894.
A 1ª Câmara Municipal foi então composta pelos seguintes  membros, que hoje seriam os legisladores e que eram denominados naquele período Governadores Municipais:                               
- Firmino Francisco Ramos (Presidente);
- Joaquim Gomes Pinheiro Sobrinho (Vice-Presidente);
- Francisco de Lima Santiago Louzada;
- Luiz Alves Viana;
- Manoel Xavier Soares.
No decorrer desta fase inicial de sua implementação a Câmara Municipal funcionou provisoriamente em vários locais, tendo sua sede definitiva em 1903, quando o então Governador Municipal Joaquim Luiz Alves Silva, inaugurou o prédio da Prefeitura Municipal e cedeu o salão nobre como sede do Poder Legislativo Municipal.
Em 1937, com a instalação do Estado Novo no Brasil, a Câmara Municipal teve seus trabalhos encerrados através da declaração da Constituição de 10 de novembro de 1937, ficando a partir daquele mopmento, sob a intervenção federal.
As atividades foram reiniciadas após eleita nova Câmara em 23 de dezembro de 1947. Foi a partir de 1947, que o processo de Constituição da  Câmara ocorreu normalmente, passando pela mesma pessoas idôneas, rionovenses autênticos que deram a sua importante contribuição para o desenvolvimento do Município de Rio Novo do Sul.
Chegados enfim os dias atuais, mais precisamente 2001, a Câmara Municipal de Rio Novo do Sul marca sua história com a eleição da primeira mulher presidente da Casa, sendo também a vereadora mais votada do município, a senhora Regina Fregonazzi Ladeia.
Atualmente a Câmara Municipal funciona em prédio próprio, construído no ano de 1988, situada à Rua Joaquim Alves, s/n - Centro.

                                                                                                    Sabe-se com segurança mercê de prova documental de confronto, que Santos foi elevada à categoria de Vila entre Setembro de 1546 e janeiro de 1547, embora não se saiba o dia exato, nem se tenha conhecimento do ato legal (FORAL) promotor dessa elevação, cremos que tenha ocorrido no dia lº de novembro de 1546 (dia de Todos os Santos), dado o costume religioso de se marcarem os grandes fatos e as grandes coisas   do       quinhentismo e do seiscentismo com as datas e invocações do hagiológico católico por coincidir o nome anteriormente dado à povoação (de SANTOS ou PORTO DE SANTOS),
com aquela invocação: Todos os Santos.
Reconhecendo-se assim que a vida legal e adminis-
trativa de Santos começou naquele ano de 1547, 
evidentemente devemos aceitar e reconhecer que
existiu uma Câmara Municipal no mesmo ano.
Em 1555, conforme revela carta de D.Duarte da Costa enviada a D.João III (escrita a 3 de abril daquele ano) foram constituídos os Conselhos de Vila como se chamavam então as antigas CÂMARAS.
O primeiro registro oficial ocorre em 1795 com livros de vereanças (Atas da Câmara, livro nº 1).
Na época Colonial, e princípio Imperial, as Câmaras ou Conselhos tinham três vereadores, sendo um deles o Procurador; na época Imperial plena, passaram a ter sete, oito e nove membros
(primeiro e segundo Império) e, na República, começaram com onze vereadores.
Em 1822, a Câmara de Santos denominava-se nas próprias atas das Sessões: Casas da Câmara e Passos do Conselho. O corpo legislativo, compunha-se, como durante o período colonial, 01 Presidente
que era o Juiz de Fóra, 03 Vereadores e 0l Procura
dor, nomeados pelo Governo da Província, e, antes,
da Capitânia.
